{"id":2,"name":"map","code":"function map({input,
              output,
              min = Number.NEGATIVE_INFINITY,
              max = Number.POSITIVE_INFINITY,
              ratio = 1}) {
        output.applyDelta(input,min,max,ratio)
}"}

